import React from 'react';
import DragDropAnimation from './DragDropAnimation';

const AnimationSection = () => {
  return (
    <section className="bg-black py-16 md:w-2/3">
      <div className="container mx-auto p-4 flex justify-between space-x-8">
        <DragDropAnimation />
      </div>
    </section>
  );
};

export default AnimationSection;
